import './App.css';
import Nav from './Nav';
import { BrowserRouter, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className='App'>
      <BrowserRouter>
      <Nav />
      <Routes>
        <Route path="/" element={<div>Home Page</div>} />
        <Route path="/usage-monitor" element={<div>Usage Monitor</div>} />
        <Route path="/janitors" element={<div>Janitors</div>} />
        <Route path="/resources" element={<div>Resources</div>} />
        <Route path="/settings" element={<div>Settings</div>} />
        <Route path="/users" element={<div>Users</div>} />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
